import * as React from 'react';
import { View, StyleSheet,ImageBackground} from 'react-native';
import { Button, ScrollView,Text } from 'react-native-web';
import {Header,
        Container,
        HeaderButtonLeft,
        HeaderButtonRight,
        Container1,
        Text1,
        Text2,
      } 
from './styles';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';


function BluebarryPancakeScreen({navigation,route}) {
  const item = route.params;
  return (
    <Container>
      <Header>
        <HeaderButtonLeft>
          <Ionicons name="chevron-back" size={20} color={"black"} onPress={navigation.goBack} />
        </HeaderButtonLeft>
        <HeaderButtonRight>
          <Entypo name="dots-two-horizontal" size={20} color="black" />
        </HeaderButtonRight>
      </Header>
      <ImageBackground source={require ('../BluebarryPancake/Vector.png')} 
        style={{position: 'absolute', 
          width: 289,
          height: 288,
          left: 43,
          top: 122
        }}
      />
      <ScrollView showsVerticalScrollIndicator={false}>
        <Container1>
          <Text1>Blueberry Pancake</Text1>
          <Text2>
            Pancakes are some people's favorite breakfast, who doesn't like pancakes? 
            Especially with the real honey splash on top of the pancakes, of course everyone loves that! besides being Read More...
          </Text2>
        </Container1>
      </ScrollView>
      <Button
        title=" Go to Meal Schedule"
        onPress={() => navigation.navigate('Meal Schedule')}
      />
    </Container> 
  );
}

export default BluebarryPancakeScreen;
